description.text:
Gikey is very easy to print, actually is designed to be printed without supports and prints good in PLA at 0.3mm and 0.2mm resolutions.
The new version made in OpenSCAD that can be edited in CUSTOMIZER.
The uploaded file is made with the custom settings:<br />
Gykeysize=15;// [12:Small,15:Medium,17:Large]<br />
lenghtGikey=14;// [12:Small,15:Medium,17:Large]<br />
//size of the nozzle of the printer<br />
nozzlesize=0.5;// [0.1:ReallySmall,0.1:Small,0.2:Medium,0.3:Ok,0.4:Large,0.5:ExtraLarge]<br />
//The wall size is this times the nozzlesize<br />
wallsizemul1and2=3;// [1:Thin,2:Ok,3:Large]<br />
//The wall size of most internal is this times the nozzlesize<br />
wallsizemult3=2;// [1:Thin,2:Ok,3:Large]<br />
//Space between layers multiplier<br />
Layers_Space=2.8;// [1:Thin,2:Ok,3:Large]
